      string: '{"id":14160,"page":1,"results":[{"author":"r96sk","author_details":{"name":"","username":"r96sk","avatar_path":"/https://www.gravatar.com/avatar/96c2e0e4ac98450f9e8e3c0a0a40aad8.jpg","rating":8.0},"content":"A
        fun and charming adventure.\r\n\r\n<em>''Up''</em> certainly knows how to
        tug at the heartstrings. It creates a very meaningful story around Carl Fredricksen
        (Ed Asner), with the early scenes particularly standing out as superb.\r\n\r\nI
        don''t overly enjoy the parts with Dug (Bob Peterson) and Kevin (Pete Docter),
        not that they are bad, though everything with Fredricksen, Russell (Jordan
        Nagai) and Charles F. Muntz (Christopher Plummer) is entertaining and/or hearty.\r\n\r\nAsner
        and Nagai do terrific, in what is one of Disney''s ''best of the rest'' films.
        There is some lovely music by Michael Giacchino, too. Go watch!","created_at":"2020-08-16T17:10:29.520Z","id":"5f396885c5840d00329e56c6","updated_at":"2021-06-23T15:58:42.695Z","url":"https://www.themoviedb.org/review/5f396885c5840d00329e56c6"},{"author":"Peter89Spencer","author_details":{"name":"","username":"Peter89Spencer","avatar_path":"/https://www.gravatar.com/avatar/dadb1b759a8516c815cdcc58abcefc85.jpg","rating":9.0},"content":"To
