      string: '{"id":49520,"page":1,"results":[{"author":"Kamurai","author_details":{"name":"Kamurai","username":"Kamurai","avatar_path":"/sKeC7qZLAKreuwxH4x6U3mN7Aa8.jpg","rating":8.0},"content":"Great
        watch, would watch again, and can recommend.\r\n\r\nThis is probably my favorite
        \"body swap\" trope movie.  It''s Ryan Reynolds and Jason Bateman for crying
        out loud.  If you''ve ever liked anything they''ve ever done (aside from \"Green
        Lantern\") then you''ll probably like this.  Seeing them do \"impressions\"
        of each other is a bonus.\r\n\r\nAs far as \"body swapping\" goes, I think
        this is the only non-parent child, non-male female swap that I''ve seen, which
        is probably what makes it a lot of fun: there''s no socio-political debate
        sitting in the background on single vs married, but all the fun of \"now I
        have to deal with THIS\".  Maybe there are some issues of how redeemable the
        characters are in their flaw sets, but it''s built into the premise.\r\n\r\nWith
        Leslie Mann and Olivia Wilde backing up the leads, everyone gives a stellar
        performance.  The production value is clearly there, though I think most of
        it went into locations and cast budgets: this isn''t an action-car-chase movie,
        it''s a \"body swap\" dirt humor rom com.\r\n\r\nThe writing does skew dirty
        in the humor, but if you have an open mind, then the humor ends up being in
        the surprise of dealing with each others lives unprepared.  Despite the juvenile
        basis of guys trying to do whatever they want, the movie is surprisingly touching
        and about togetherness.","created_at":"2020-07-15T00:11:11.803Z","id":"5f0e499feec5b50036d7b2b8","updated_at":"2021-06-23T15:58:40.637Z","url":"https://www.themoviedb.org/review/5f0e499feec5b50036d7b2b8"}],"total_pages":1,"total_results":1}'
