    body:
      encoding: ASCII-8BIT
      string: '{"id":239566,"page":1,"results":[{"author":"r96sk","author_details":{"name":"","username":"r96sk","avatar_path":"/https://www.gravatar.com/avatar/96c2e0e4ac98450f9e8e3c0a0a40aad8.jpg","rating":7.0},"content":"Chadwick
        Boseman is terrific, but <em>''Get on Up''</em> is missing something that
        would make it a great biopic.\r\n\r\nI still very much enjoyed it, I always
        tend to find biographical films interesting - especially when I don''t know
        too much about the person(s) in question, as is the case with James Brown
        here; I''ve always known of him and his major songs, but that''s about it.\r\n\r\nBoseman
        leads strongly, carrying the film really. That''s not to say he''s alone in
        terms of the onscreen talent, as there are others who I liked. Dan Aykroyd
        is solid, while Octavia Spencer and Viola Davis are welcomed cast members.
        The brilliant Lennie James is also involved, admittedly in a relatively small
        role.\r\n\r\nWith all that noted, I just felt there was something missing.
        I can''t exactly pinpoint what that is. One of the things I felt from the
        start was the lack of likeability I had for the lead character, perhaps that
        was intentional though. The ''breaking the fourth wall'' stuff is iffy, too.\r\n\r\nThe
        139 run time probably comes into it as well, while the ageing for Boseman
        & Co. isn''t the best I''ve seen - which isn''t good, given the film opens
        with a scene that requires ageing so it naturally stuck in my memory more.
        As also mentioned at the top, I didn''t come into this knowing all about James
        Brown and his music/life so that likely plays a part - though I''ve seen other
        biopics under similar circumstances and it hasn''t affected my enjoyment.\r\n\r\nThere
        are still other positives, aside from the cast, of course. I actually liked
        the non-linear structure of how the story is told, while the cinematography
        is pleasant. The music is also worked in well.\r\n\r\nAll in all, it''s a
        film that I would recommend. It had all the ingredients to be grander though.","created_at":"2020-10-25T12:45:37.980Z","id":"5f957371eea34d004203e68e","updated_at":"2021-06-23T15:58:46.592Z","url":"https://www.themoviedb.org/review/5f957371eea34d004203e68e"}],"total_pages":1,"total_results":1}'
